import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <h3>About Me</h3>
        <p>Weather enthusiast providing accurate weather information worldwide.</p>
      </div>
    </footer>
  );
};

export default Footer;
